const Product = ({post}) => {

  
  return (
    <div>
      <div>
        <div>
          <p>{post.title}</p>
        </div>
        
        <div>
          <p>{post.description}</p>
        </div>
        
        <div>
          <img src={post.image}/>
        </div>
        
        <div>
          <p>{post.price}</p>
        </div>

        <button>
          {
            false ? <p>Remove Item </p> : <p>Add to Cart</p>
          }
        </button>

      </div>
    </div>
  );
};

export default Product;
